import Home from './pages/Home';
import { Switch, Router, Route } from "wouter"

function App() {
  return (
    <Router>

      <Switch>
        <Route path="/" component={Home} />
        <Route path="/login" component={Home} />
      </Switch>
    </Router>
  );
}

export default App;
